import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";
import Sdata from "./Sdata";
import './index.css';


function ncard(val){
    return (
        <Cards
            imgsrc = {val.imgsrc}
            title = {val.title}
            seriesName = {val.seriesName}
            link = {val.link}
        />
    )
}

ReactDOM.render(
    <>
     {Sdata.map(ncard)}
    </>
    ,document.getElementById('root')
)
